func ReplayCmd() *cobra.Command {
	cmd := &cobra.Command{
		Use:   "replay",
		Short: "Replay",
		RunE:  runReplayCmd,
		Args:  cobra.NoArgs,
	}
	return cmd
}

func runReplayCmd(cmd *cobra.Command, args []string) error {
	ctx := server.GetServerContextFromCmd(cmd)
	ctx.Viper.BindPFlags(cmd.Flags())

	_, err := server.GetPruningOptionsFromFlags(ctx.Viper)
	cfg := ctx.Config
	home := cfg.RootDir
	dataDir := filepath.Join(home, "data")
	db, err := sdk.NewLevelDB("application", dataDir)
	if err != nil {
		panic(err)
	}
	traceWriterFile := ctx.Viper.GetString("trace-store")
	var traceWriter io.Writer
	if traceWriterFile != "" {
		traceWriter, err = os.OpenFile(
			traceWriterFile,
			os.O_WRONLY|os.O_APPEND|os.O_CREATE,
			0666,
		)
		if err != nil {
			panic(err)
		}
	}
	application := NewApp(ctx.Logger, db, traceWriter, ctx.Viper)
	typedApp := application.(*app.App)
	hashbz, _ := hex.DecodeString("8C111942E72876EBAC149C38B6699133C9054B51481ABA076C7F564CD22A8155")
	layout := "2006-01-02T15:04:05.000Z"
	str := "2022-10-29T14:39:17.694Z"
	t, _ := time.Parse(layout, str)
	blockIdHashBz, _ := hex.DecodeString("077E9DF2B39EE28A6168FD59DCA1425553165A9BFB69638CDF1CDF2BC87CBECD")
	partBz, _ := hex.DecodeString("C9B41820C7D88D4ED37257BF8452ADE2FF1F6CD8F7F998756D9E83889D960C0F")
	lastCommitBz, _ := hex.DecodeString("9E77E4F75312D81FD1F621C40EDCD37EECA0C6C815568065C25E833F0A4D910D")
	dataBz, _ := hex.DecodeString("F22760491CC972087D6357B4C961B4F5FE658C847FAD46B3FEB396F12017D470")
	validatorBz, _ := hex.DecodeString("A2638B5DF62B65AEC5E0C3F06FC3D1A769F222E7F4887B7094272873F7E4C234")
	nextValBz, _ := hex.DecodeString("A2638B5DF62B65AEC5E0C3F06FC3D1A769F222E7F4887B7094272873F7E4C234")
	consensusBz, _ := hex.DecodeString("1BF2556CA5D5D7EFFB540F34CB0FFC77A3202E32275557AFBD219882A9E42ACF")
	appBz, _ := hex.DecodeString("A99893CD6CB738AEB950C488E1CB9D5A116D8FC511A4987C3D9C587988CCAF7C")
	lastResultBz, _ := hex.DecodeString("1FCCC84710C72CDB9195281F27D0881C333C4D659C0FA2F643CA6D87ED69063A")
	evidenceBz, _ := hex.DecodeString("E3B0C44298FC1C149AFBF4C8996FB92427AE41E4649B934CA495991B7852B855")
	proposerBz, _ := hex.DecodeString("2BA9A12DBD9B837CDB8F33551FA655CC6CCCBF17")
	typedApp.BeginBlock(types.RequestBeginBlock{
		Hash: hashbz,
		Header: types1.Header{
			Version: version.Consensus{Block: 11},
			ChainID: "atlantic-1",
			Height:  9736348,
			Time:    t,
			LastBlockId: types1.BlockID{
				Hash: blockIdHashBz,
				PartSetHeader: types1.PartSetHeader{
					Total: 1,
					Hash:  partBz,
				},
			},
			LastCommitHash:     lastCommitBz,
			DataHash:           dataBz,
			ValidatorsHash:     validatorBz,
			NextValidatorsHash: nextValBz,
			ConsensusHash:      consensusBz,
			AppHash:            appBz,
			LastResultsHash:    lastResultBz,
			EvidenceHash:       evidenceBz,
			ProposerAddress:    proposerBz,
		},
	})
	for _, tx := range Txs {
		rawTx, _ := base64.StdEncoding.DecodeString(tx)
		typedApp.DeliverTx(types.RequestDeliverTx{
			Tx: rawTx,
		})
	}
	typedApp.EndBlock(types.RequestEndBlock{
		Height: 9736348,
	})
	typedApp.Commit()

	return nil
}
